// Schedule.js
import React, { useState } from 'react';
import DataTable from '../DataTable/DataTable'; // Ensure the correct import path
import scheduleDataJson from '../Schedule/scheduleData.json';
import './Schedule.css';

function Schedule() {
  const [search, setSearch] = useState('');

  return (
    <section id="schedule">
      <h1>Weekly Schedule</h1>
      <div className="schedule-container">
        <input
          type="text"
          placeholder="Search by Day, Time, or Event"
          value={search}
          onChange={(e) => setSearch(e.target.value)}
          className="search-input"
        />
        {/* Ensure that scheduleDataJson is defined and contains valid data */}
        {scheduleDataJson && scheduleDataJson.length > 0 && (
          <DataTable data={scheduleDataJson} />
        )}
      </div>
    </section>
  );
}

export default Schedule;
